import Calendar from 'react-calendar'
import { useState } from 'react';

const CalendarDisplay = () => {
    const [value, onChange] = useState(new Date());

    return (
      <div>
          <h1>Calendar View</h1>
        <Calendar
          onChange={onChange}
          value={value}
        />
      </div>
    );
}
 
export default CalendarDisplay;
